import React, { useEffect, useState } from "react";

const Timer = () => {
  const [message, setMessage] = useState("Evondev");
  useEffect(() => {
    setInterval(() => {
      console.log(message);
    }, 2000);
  }, [message]);
  return <div></div>;
};

export default Timer;
